INSERT INTO `pus_katalog` VALUES ('1', 'Tiga manula jalan-jalan ke Selatan Jawa`', '741.5', '15', '741.5 RAC t', '14', '4', '9789799106308', '', '', '2013', '', '', null, 'Jakarta', '', '', '', '96', '17 cm', '1', '3', 'Pantang menyerah mencari Tingal, desa kelahiran Waluyo, Tiga Manula kini menyusuri Selatan Jawa. Tiga makam presiden diziarahi, Solo-Yogya dinikmati, Candi Borobudur didaki, Nusakambangan dijelajahi, dan beragam kuliner dicicipi. Dimanakah sebenarnya');
INSERT INTO `pus_katalog` VALUES ('2', 'Sally Ann thunder Ann whirlwind crockett`', '813', '16', '813 KEL s', '19', '9', '0590969994', '', '', '1995', '', '', null, 'New York', '', '', '', '48', '28 cm', '2', '3', 'Sally ann thunder ann is the strongest, fastes woman around. But is she strong enough to rescue Davy Crockett and beat the mighty Mike Fink.');
INSERT INTO `pus_katalog` VALUES ('3', 'Crime and Punishment`', '813', '16', '813 DOS c', '12', '5', '9781840224306', '', '', '2000', '', '', null, 'London', '', '', '', '486', '20 cm', '2', '3', 'This book is one of the greatest and most readable novels ever written. From the beginning we are locked into the frenzied consciousness of Raskolnikov who, againts his better instinest, is inexorably draw to commit a brutal double murder.');
INSERT INTO `pus_katalog` VALUES ('4', 'Sunshine becomes you`', '823', '12', '823 TAN s', '9', '4', '9789792278132', '', '', '2012', '', '', null, 'Jakarta', '', '', '', '432', '20 cm', '1', '3', 'Awalnya, Alex Hirano lebih memilih jauh-jauh dari gadis itu-malaikat kegelapan yang membuatnya cacat. Kemudian Mia Clark tertawa, dan Alex bertanya-tanya bagaimana ia bisa berpikir gadis yang memiliki tawa secerah matahari itu adalah malaikat kegelap');
INSERT INTO `pus_katalog` VALUES ('5', 'Hiu dan monster bawah laut`', '597.3', '14', '597.3 BAR h', '13', '15', '9786020032825', '', 'KURNIAWAN, Andri', '2012', '', '', null, 'Jakarta', '', '', '', '190', '18cm', '1', '3', 'Menampilkan lebih dari 80 hiu paling menakutkan dan terburuk di dunia, lintah, aligator, cumi-cumi dan binatang bawah air lainnya.');
INSERT INTO `pus_katalog` VALUES ('6', 'Tarzan kota`', '823', '12', '823 SUP t', '16', '7', '9792110747', '', '', '2005', '', '', null, 'Yogyakarta', '4', 'Tito', '', '28', '25 cm', '1', '3', 'Tito adalah tokoh kucing yang sok aksi. Dia suka usil dan kadang-kadang juga nakal. Meskipun demikian, Tito punya kelebihan, misalnya pandai bergaul, tidak mudah sakit hati, dan selalu menyesali kesalahannya.');
INSERT INTO `pus_katalog` VALUES ('7', '5 cm`', '823', '12', '823 DHI 5', '15', '14', '9789790818521', '', '', '2013', 'NUSANTARA, A. Ariobimo', '', null, 'Jakarta', '', '', '', '382', '21 cm', '1', '3', 'Sore ini, setelah menyelesaikan halaman terakhir 5 cm-nya Donny Dhirgantoro, saya terdiam lama dan menangis. Buku ini, entah bagaimana, membuat saya memandang dunia, hidup, dan segala sesuatu di sekitar saya, dengan cara yang berbeda.');
INSERT INTO `pus_katalog` VALUES ('8', 'Getting around in the city`', '813', '16', '813 ADA g', '20', '10', '0153276509', '', '', '0', '', '', null, 'Orlando', '', '', '', '16', '20 cm', '2', '3', 'I kive in the city. It is a big, busy place. There are so many ways to get around in the city.');
INSERT INTO `pus_katalog` VALUES ('9', 'Yes you can, Kerry`', '813', '16', '813 APP y', '21', '10', '0153230754', '', '', '0', '', '', null, 'Orlando', '', '', '', '16', '20 cm', '2', '3', 'It was the first day of school. Nine young fish were gathered there. Most clustered in a shell waiting for the teacher.');
INSERT INTO `pus_katalog` VALUES ('10', 'Huggly\'s halloween`', '813', '16', '813 ARN h', '22', '9', '0439324491', '', '', '2002', '', '', null, 'New York', '', '', '', '30', '20 cm', '2', '3', 'Huggly and his friends live in the monster world. But sometimes the human world is just too hard to resist. That\'s when the fun begins...');
INSERT INTO `pus_katalog` VALUES ('11', 'Huggly goes to school`', '813', '16', '813 ARN h', '22', '9', '0439134994', '', '', '2000', '', '', null, 'New York', '', '', '', '30', '20 cm', '2', '3', 'Huggly doesn\'t realize that his perfect hide-and-seek hiding spot is...a school. Can Huggly and his friends pretend to be people without getting caught.');
INSERT INTO `pus_katalog` VALUES ('12', 'Tommy tractor\'s new job`', '813', '16', '813 AND t', '23', '11', '1841352578', '', '', '2003', '', '', null, 'London', '', '', '', '28', '23 cm', '2', '3', 'Tommy tractor has a very busy job throughout the year on Parship farm. But when farmer peadley becomes ill, life begins to change.');
